import React from "react";
import NavBar from "./Nav-bar";
import Hero from "./Hero";
import About from "./about";
import AOS from "aos";
import Service from "./service";
function App() {
  AOS.init();
  return (
    <div>
       <NavBar />
       <Hero />
       <main id="main">
         <About />
         <Service />
       </main>
    </div>

  );
}

export default App;
